import React from "react";
import './App.css';
class App extends React.Component {

	// Constructor
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false
		};
	}

	// ComponentDidMount is used to execute the code
	componentDidMount() {
		fetch("https://jsonplaceholder.typicode.com/users")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true
				});
			})
	}

	render() {
		const { DataisLoaded, items } = this.state;
		if (!DataisLoaded) return <div>
			<h1 classname="App-link"> Loading... </h1> </div> ;

		return (
		<div className = "App">
			<h1> Welcome to your training hub! </h1> {
				items.map((item) => (
				<><ol key={item.id}>
            Name: {item.name},
            Distance: {item.username},
            Duration: {item.email}
          </ol><p>CS3219 OTOT Task B4</p></>
				))
			}
		</div>
	);
}
}

